// src/components/Sidebar.js
import React from 'react';
import {
  Drawer, List, ListItem, ListItemText, ListItemIcon,
  Box, Divider, Typography, IconButton
} from '@mui/material';
import {
  Dashboard as DashboardIcon,
  People as PeopleIcon,
  ShoppingCart as OrderIcon,
  Inventory as InventoryIcon,
  Payment as PaymentIcon,
  Assessment as ReportIcon,
  Logout as LogoutIcon,
  Menu as MenuIcon
} from '@mui/icons-material';
import { Link, useLocation, useNavigate } from 'react-router-dom';
import { motion } from 'framer-motion';

const drawerWidth = 260;

const links = [
  { to: '/', text: 'Dashboard', icon: <DashboardIcon /> },
  { to: '/customers', text: 'Customers', icon: <PeopleIcon /> },
  { to: '/orders', text: 'Orders', icon: <OrderIcon /> },
  { to: '/inventory', text: 'Inventory', icon: <InventoryIcon /> },
  { to: '/payments', text: 'Payments', icon: <PaymentIcon /> },
  { to: '/reports', text: 'Reports', icon: <ReportIcon /> },
];

export default function Sidebar() {
  const location = useLocation();
  const navigate = useNavigate();
  const [open, setOpen] = React.useState(true);

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/login');
  };

  return (
    <>
      <IconButton
        onClick={() => setOpen(!open)}
        sx={{
          position: 'fixed',
          top: 16,
          left: open ? drawerWidth - 30 : 16,
          zIndex: 1300,
          bgcolor: 'white',
          boxShadow: 3,
          '&:hover': { bgcolor: '#f0f0f0' }
        }}
      >
        <MenuIcon />
      </IconButton>

      <Drawer
        variant="persistent"
        open={open}
        sx={{
          width: drawerWidth,
          flexShrink: 0,
          '& .MuiDrawer-paper': {
            width: drawerWidth,
            boxSizing: 'border-box',
            bgcolor: '#1a3e72',
            color: 'white',
            transition: 'width 0.3s ease',
          },
        }}
      >
        <Box sx={{ p: 3, textAlign: 'center' }}>
          <motion.div
            initial={{ scale: 0.8 }}
            animate={{ scale: 1 }}
            transition={{ duration: 0.5 }}
          >
            <Typography variant="h5" sx={{ fontWeight: 700, letterSpacing: 1 }}>
              Ice Pressing
            </Typography>
            <Typography variant="caption">Yaound√© Dry Cleaning</Typography>
          </motion.div>
        </Box>
        <Divider sx={{ bgcolor: 'rgba(255,255,255,0.2)' }} />

        <List>
          {links.map((l) => (
            <motion.div
              key={l.to}
              whileHover={{ x: 5 }}
              whileTap={{ scale: 0.95 }}
            >
              <ListItem
                button
                component={Link}
                to={l.to}
                selected={location.pathname === l.to}
                sx={{
                  my: 1,
                  mx: 2,
                  borderRadius: 2,
                  bgcolor: location.pathname === l.to ? 'rgba(255,255,255,0.2)' : 'transparent',
                  '&:hover': { bgcolor: 'rgba(255,255,255,0.1)' },
                }}
              >
                <ListItemIcon sx={{ color: 'white' }}>{l.icon}</ListItemIcon>
                <ListItemText primary={l.text} />
              </ListItem>
            </motion.div>
          ))}
        </List>

        <Box sx={{ mt: 'auto', p: 2 }}>
          <Divider sx={{ bgcolor: 'rgba(255,255,255,0.2)', mb: 2 }} />
          <ListItem button onClick={handleLogout} sx={{ borderRadius: 2, '&:hover': { bgcolor: 'rgba(255,255,255,0.1)' } }}>
            <ListItemIcon sx={{ color: 'white' }}><LogoutIcon /></ListItemIcon>
            <ListItemText primary="Logout" />
          </ListItem>
        </Box>
      </Drawer>
    </>
  );
}
